import React from 'react';
import axios from 'axios';
import { Link as RouterLink } from 'react-router-dom';
import { AppBar, BottomNavigation, BottomNavigationAction } from '@material-ui/core';
import HomeIcon from '@material-ui/icons/Home';
import MenuIcon from '@material-ui/icons/Menu';
import PhoneIcon from '@material-ui/icons/Phone';
import CheckCircleIcon from '@material-ui/icons/CheckCircle';
import HelpIcon from '@material-ui/icons/Help';
import $ from "jquery";

class NavBar extends React.Component {
    constructor(props) {
        super(props)
        const dt = new Date()
        this.state = {
            start: dt,
            lastClickTime: dt
        }
    }

    componentDidMount() {
        $("div").click(function() {
            $(".animated").css("animation-play-state", "paused");
        });
    }

    logClick = (e) => {
        const dt = new Date()
        axios({
            method: 'post',
            url: 'http://localhost:8080/logging',
            data: {
                id: e.currentTarget.id,
                time: (dt - this.state.start) / 1000
            }
        })

    }

    render() {
        const currentPath = window.location.pathname
        return (
            <AppBar position="fixed" style={{top: 'auto', bottom: 0}}>
                <BottomNavigation>
                    <BottomNavigationAction label="Menu" id="menu" icon={ <MenuIcon/>} onClick={this.logClick} />
                    {currentPath.includes("page") ?
                        <BottomNavigationAction label="Home" id="home" icon={<HomeIcon/>} component={RouterLink} to="/" onClick={this.logClick} /> :
                        <BottomNavigationAction label="Accept" id="accept" icon={<CheckCircleIcon/>} component={RouterLink} to="/page" onClick={this.logClick} />
                    }
                    {currentPath.includes("page") ?
                        <BottomNavigationAction label="Question" id="question" icon={<HelpIcon/>} /> :
                        <div className="animated">
                            <BottomNavigationAction classes={"stop-animation"} label="Phone" id="phone" icon={<PhoneIcon/>} onClick={this.props.getPhoneClick}/>
                        </div>
                    }
                </BottomNavigation>
            </AppBar>
        );
    }
}

export default NavBar;
